  <style>
    .bg {
      background-color: #eff0f3;
    }
    .headline {
      color: #0d0d0d;
    }
    .topSection {
      padding: 50px .5rem;
    }
    .card {
      border: 0;
      box-shadow: 0 0.25rem 1rem rgba(48,55,66,.15);
      height: 100%;
      margin-bottom: 3.5rem;
    }
    .headerLogo {
      top: 20px;
      right: 20px;
      float: right;
      z-index: 10;
      position: fixed;
      padding: 10px;
      box-shadow: 0 0.25rem 1rem rgba(48,55,66,.15);
      background-color: white;
      cursor: pointer;
    }
    .headerLogo a img{
      border: 0;
    }
    .card-header {
      display: flex;
    }
    .card-header, .card-body {
      padding-left: 2rem !important;
    }
    .card-image {
      text-align: center;
      padding: 0.5rem;
    }
    .card-image img{
      box-shadow: 0 0.25rem 1rem rgba(48,55,66,.15);
      /* max-width: 750px; */
      margin: 0.7rem auto;
      display: unset !important;
    }
    .toc, .tocFake {
      z-index: 10;
      position: fixed;
      top: 60px;
      left: 15px;
      max-width: 250px;
      padding: 10px;
      box-shadow: 0 0.25rem 1rem rgba(48,55,66,.15);
      background-color: white;
      overflow: auto;
      max-height: calc(80vh);
    }
    .tocFake {
      cursor: pointer;
      top: 20px;
    }
    @media (max-width:1350px){
      .toc {
        max-width: 200px;
      }
    }
    @media (max-width:1150px){
      .headerLogo {
        display: none;
      }
    }
    .headline:focus, .headline:hover {
      outline : none !important;
    }
    .toc-link::before{
      width:5px;
    }
    .is-active-link::before{
      background-color: rgba(255,196,35,1);
    }
    .toc-link {
      font-size: 0.8em;
    }
    .doubleCheesburger {
      width: 12px;
      height: 12px;
      background-size: contain;
      background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAEAAAABACAYAAACqaXHeAAAABmJLR0QA/wD/AP+gvaeTAAAAw0lEQVR4nO3YMQ7CMAxG4Qc74gJlRL07qjgBV+rQXCAMHUBRhiAKSdv3SV482R48/CBJkiRJLxdgAAIQV14BuAP9J8uPDQy+dI1AV3KAoYFhf1W3dNlD5gABOJVcaoUCcH5vHCsNUktMG7kDPP4wSC1Fu/Vs9wleSy/VMT+MqYHBv62J+bEXLy9JkvbNPKCBwZcu8wDMA8wDYtowD8gwD8A8QJIk7Zh5QAODL13mAZgHmAfEtGEekGEegHmAJEmSpI17AhoPKkbYwzDbAAAAAElFTkSuQmCC);
    }
    .form-checkbox {
      display: inline;
      margin-right: 10px;
    }
    input[type="checkbox"], .form-icon {
      transform:scale(2, 2);
    }
    .stepTitle {
      display:inline-block;
    }
    .substepTitle {
      padding: 0.3rem 1rem;
      font-weight: 600;
    }
    .substepDescription {
      padding: 0.3rem 1rem;
    }
    .card {
      border: 2px solid transparent;
    }
    .completedCard {
      border: 2px solid #2a9a39;
      box-shadow: 0 0.25rem 1rem rgb(43 154 56 / 0.45);
    }

    .form-checkbox input:checked+.form-icon,
    .form-radio input:checked+.form-icon,
    .form-switch input:checked+.form-icon {
      background: #00c400;
      border-color: #00c400
    }

    .form-checkbox input:focus+.form-icon,
    .form-radio input:focus+.form-icon,
    .form-switch input:focus+.form-icon {
      border-color: #00c400;
      box-shadow: 0 0.25rem 1rem rgb(43 154 56 / 0.2);
    }

    .form-checkbox input:indeterminate+.form-icon {
      background: #00c400;
      border-color: #00c400
    }
    .form-checkbox.bottom {
      margin-bottom: 15px;
      margin-left: auto;
      margin-right: 10px;
      margin-top: 5px;
    }
    @media (max-width:992px){
      p {margin:0}
      blockquote {margin:0}
      .container.grid-md {max-width:1296px}
      .card {margin-bottom:1rem}
      .col-xs-10,.col-md-10,.col-xl-10 {width:100%}
    }

  border-color: #90cdf4;

}

}

.stepTextBlock.dark {

}

.stepTextBlock.success .stepTextBlockIcon {
  border-color: #48bb78;
  background-color: #f0fff4;
  color: #48bb78;
}
.stepTextBlock.warning .stepTextBlockIcon {
  border-color: #ecc94b;
  background-color: #fffff0;
  color: #ecc94b;
}
.stepTextBlock.dark .stepTextBlockIcon {
  border-color: #e5e7eb;

}

.stepTextBlock .stepTextBlockIcon svg{
  width: 1.5em;
}
.stepTextBlock .stepTextBlockContent {
  margin-left: 1em;
}
.stepTextBlock .stepTextBlockTitle {
  font-size: 1.125em;
  font-weight: 600;
}
.stepTextBlock.error .stepTextBlockTitle {
  color: #9b2c2c;
}
.stepTextBlock.dark .stepTextBlockTitle {
  color: #212936;
}
.stepTextBlock.info .stepTextBlockTitle {
  color: #2c5282;
}
.stepTextBlock.success .stepTextBlockTitle {
  color: #276749;
}
.stepTextBlock.warning .stepTextBlockTitle {
  color: #975a16;
}
.stepTextBlock .stepTextBlockDescription {
  font-size: .875em;
}
.stepTextBlock.error .stepTextBlockDescription {
  color: #e53e3e;
}
.stepTextBlock.info .stepTextBlockDescription {
  color: #3182ce;
}
.stepTextBlock.success .stepTextBlockDescription {
  color: #38a169;
}
.stepTextBlock.warning .stepTextBlockDescription {
  color: #d69e2e;
}
.stepTextBlock.dark .stepTextBlockDescription {
  color: #1f2937;
}
.stepTextBlock .stepTextBlockDescription p {
  padding: 0;

    window.onload = function() {
      tocbot.init({
        // Where to render the table of contents.
        tocSelector: '.toc',
        positionFixedSelector: '.toc',
        // Where to grab the headings to build the table of contents.
        contentSelector: '.section',
        // Which headings to grab inside of the contentSelector element.
        headingSelector: '.headline',
        ignoreSelector: '.substep',
        onClick: function(e) {
          // After user clicks ToC item, refresh tocbot to properly highlight active item
          setTimeout(() => {
            tocbot.refresh();
          }, 50)
        },
        headingsOffset: 5,
        headingLabelCallback: function(heading, node) {
          var ancestor = findAncestor(node, 'card');
          var isCompleted = ancestor && (findAncestor(node, 'card').classList.contains('completedCard'));
          return (isCompleted ? '✅ ' : '') + heading.trim();
        }
      });
      var tocFake = document.getElementsByClassName('tocFake')[0]
      var tocReal = document.getElementsByClassName('toc')[0];
      tocFake.addEventListener('click', function() {
        toggleClassName(tocFake, 'show-md');
        toggleClassName(tocReal, 'hide-md');
      })
      

      var nodes = document.getElementsByClassName('completionCheckbox')
      var checkboxes = Array.prototype.slice.call(nodes);
      checkboxes.forEach(checkboxListener)
    }
    function toggleClassName(element, className) {
      element.classList.toggle(className);
    }
    var scrollTo = (element) => {
      window.scroll({
        behavior: 'smooth',
        left: 0,
        top: element.offsetTop
      });
    }
    function checkboxListener(checkbox) {
      checkbox.addEventListener('change', function(event) {
        var stepId = event.target.getAttribute('data-step-id');
        var stepIdParts = stepId.split('-');
        var isChecked = event.target.checked
        var cardNode = document.querySelector('.card[data-step-id="'+stepId+'"]');
        cardNode.classList.toggle('completedCard');
        
        if(isChecked) {
          var nextId = parseInt(stepIdParts[1]) + 1;
          var nextCardNode = document.querySelector('.card[data-step-id="step-'+nextId+'"]');
          if(nextCardNode) {
            scrollTo(nextCardNode);
          }
        }
        tocbot.refresh();
      })
    }
    function findAncestor (el, cls) {
        while ((el = el && el.parentElement) && !el.classList.contains(cls));
        return el;
    }
  </script>
